import React from "react";
import {Link} from "react-router-dom";
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Img1 from '../img/service_1.jpg';


const useStyles = makeStyles({
  root: {
    color: "#383e56",
    maxWidth: 345,
    marginLeft: "auto",
    marginRight: "auto",
    marginTop: "2em"
  },
  media: {
    height: 300,
  },
  buttonStyle: {
    color: "#d4b5b0",
  },
  textStyle: {
    color: "#383e56",
    '&:hover': {
      color: "#d4b5b0",
    },
  },

});

function CardComponent1() {

  const classes = useStyles();

  return (
    <Card className={classes.root}>
      <CardActionArea>
        <Link to="/leistung1">
          <CardMedia
            className={classes.media}
            image={Img1}
            title="Contemplative Reptile"
          />
        </Link>
        <CardContent>
          <Link to="/leistung1" className={classes.textStyle}>
            <Typography gutterBottom variant="h5" component="h2">
              Mutter-Kind-Pass
            </Typography>
          </Link>
          <Typography variant="body2" color="textSecondary" component="p">
            Ich helfe Ihnen Ihr Baby zu bekommen. Machen m√ºssen Sies schon selber.
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small">
          <Link className={classes.textStyle} to="/leistung1">Mehr Infos</Link>
        </Button>
      </CardActions>
    </Card>
  );
}

export default CardComponent1;
